#include <iostream>
#include <iomanip>
using namespace std;

double toCelcius(double f)
{
    return (f - 32) * 5.0 / 9.0;
}

int main() {
    double f;
    cin >> f;

    if (f < -100 || f > 500)
    {
        cout << "Temperature must be between -100 and 500 Fahrenheit." << endl;
        return 1;
    }

    double c = toCelsius(f);
    cout << fixed << setprecision(2);
    cout << f << " F is " << c << " C" << endl;

    return 0;
}

